import React from 'react';
import '../../App.css';
import Login from '../Register/Register';
import Footer from '../Footer/Footer';

class SignUp extends React.Component {
  render(){
    return (
      <>
        <div className='sign-up'>
          <Login />
        </div>
        <Footer />
      </>
    )
  }
}

export default SignUp;
